    public static extern AudioChannelLayout Surround_7_1 { get; }
    /// <summary>7.1.4 surround sound consists of twelve channels: &lt;strong&gt;Left&lt;/strong&gt;, &lt;strong&gt;Right&lt;/strong&gt;, &lt;strong&gt;Center&lt;/strong&gt;, &lt;strong&gt;SurroundLeft&lt;/strong&gt;, &lt;strong&gt;SurroundRight&lt;/strong&gt;, &lt;strong&gt;BackLeft&lt;/strong&gt;, &lt;strong&gt;BackRight&lt;/strong&gt;, &lt;strong&gt;Sub&lt;/strong&gt;, &lt;strong&gt;TopLeft&lt;/strong&gt;, &lt;strong&gt;TopRight&lt;/strong&gt;, &lt;strong&gt;TopBackLeft&lt;/strong&gt;, and &lt;strong&gt;TopBackRight&lt;/strong&gt;. 7.1.4 is the only currently supported channel layout that encodes height information. &lt;img src="/assets/engine-api/enums/AudioChannelLayout/Surround_7_1_4.jpg" width="810" alt="Diagram showing position of channels for Surround 7.1.4 layout." /&gt;</summary>
